import "./App/stylesheets/index.scss";
import {ProjectId} from "./App/Components/ProjectCard/ProjectCard"

const root = ReactDOM.createRoot(document.getElementById("root"));

root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);
